tinymce.PluginManager.add('tinyfilemanager.net',function(editor){function openmanager(){var win,data,dom=editor.dom,imgElm=editor.selection.getNode();var width,height,imageListCtrl;win=editor.windowManager.open({title:'File Manager',file:tfm_path+'/dialog.aspx?editor='+editor.id+'&lang='+tinymce.settings.language,filetype:'all',classes:'tinyfilemanager.net',width:900,height:600,inline:1})}editor.addButton('tinyfilemanager.net',{icon:'browse',tooltip:'Insert file',onclick:openmanager,stateSelector:'img:not([data-mce-object])'});editor.addMenuItem('tinyfilemanager.net',{icon:'browse',text:'Insert file',onclick:openmanager,context:'insert',prependToContext:true})});